import './App.css';
import { Cart, Main } from './pages';
import { Route } from 'react-router-dom';

function App() {
  return (
    <div>

      <Route path="/" render={<Main />} />
      <Route path="/cart" render={<Cart />} />
    </div>
  );
}

export default App;
